import React from 'react'
import PrimarySearchAppBar from '../config/components/appbar'
import Extra from '../config/components/extra'
import "../App.css";
import SMButton from "../config/components/button";
function Mainweb() {
  return (
    <>
    <PrimarySearchAppBar/>
    <div className='div1'>
    <img  className='imgmain'  src={"https://www.siteminder.com/wp-content/uploads/2019/11/hotel-management-blog-feat.jpg"}/>
    {/* <SMButton className="book" label={"Book Now"}/> */}
  <div className='book'><SMButton size={"large"} color={"error"} variant={"outlined"} className={"mainbtn"} label={"Book Now"}/></div>
    </div>
    <Extra />
    </>
  )
}

export default Mainweb
